function precisionRound(number, precision) {
  var factor = Math.pow(10, precision);
  return Math.round(number * factor) / factor;
}
function calcMonthly(e, t, n) {
    var r;
    var n = yearRate(n);
    var e;
    r = e * Math.pow(1 + n, t) * n / (Math.pow(1 + n, t) - 1);	
    return twoDecimal(r)
}

function yearRate(n) {	
     r = n / 100 / 12;  
    return r
}

function amortizePmts(e, t, n, r) {	
    var i = e;
    var s = e;
    t = t / 100 / 12;
    var o = r;
    var u = 0;
    var a = 0;
    var x = 0;
    var f;
    var l;
    var xi = 0;
	
    var c = new Array;
    var h = new Array;
    for (var p = 1; p <= n; p++) {
        var d = p % 12;
        var v = p;
        u = s * t;
        l = twoDecimal(u);
        a = a + u;
        if (p < n) {
            o = twoDecimal(r - l);
            i = s;
            s = twoDecimal(i - o)
        } else {
            o = i - o + u;
            i = s;
            s = 0;
            o = twoDecimal(o)
        }
        c.push(o);
        h.push(l);
        if (d == 0) {
			
			
            var m = (getSum(c));
            var g = (getSum(h));
			
			//console.log(m,g);
