			x = "x" + v.toString(10);
			displayTableField(x, Number(g)+Number(m));
			
			
			f = "nb" + v.toString(10);
            displayTableField(f, number_format(s));
			
			
			  xi = "xi" + v.toString(10);
             displayTableField(xi, 0);
			
            c = new Array;
            h = new Array;
			
			
        }
    }
    return
}

function displayTableField(e, t) {
    document.getElementById(e).innerHTML = t;
    return
}



function twoDecimal(e) {
      
    var e;	
    var t = e.toFixed(2);	
    return t
}

function getSum(e) {
	
	    
    var n = 0;
    for (t = 0; t < e.length; t++) {
        if (e[t]) {
            //n = parseInt(n) + parseInt(e[t])
            n =  parseInt(e[t]);
        }
    }
    return twoDecimal(n)
}

function amortizePmtsCharts(e, t, n, r) {
    var i = e;
    var s = e;
