    for (var y = 1; y <= n; y++) {
        var b = y % 12;
        var w = y;
        u = s * t;
        l = twoDecimal(u);
        a = a + u;
        if (y < n) {
            o = twoDecimal(r - l);
            i = s;
            s = twoDecimal(i - o)
        } else {
            o = i - o + u;
            i = s;
            s = 0;
            o = twoDecimal(o)
        }
        c.push(o);
        h.push(l);
        if (b == 0) {
            var E = y / 12;
            var S = "Year " + E;
            var x = parseInt(getSum(c));
            var T = parseInt(getSum(h));
            c = new Array;
            h = new Array;
            p.push(x);
            d.push(T);
            v.push(s);
            g.push(S)
        }
    }
    m.push(p);
    m.push(d);
    m.push(g);
    return m
}

function number_format(e, t, n, r) {
    e = (e + "").replace(/[^0-9+\-Ee.]/g, "");
    var i = !isFinite(+e) ? 0 : +e,
        s = !isFinite(+t) ? 0 : Math.abs(t),
        o = typeof r === "undefined" ? "," : r,
        u = typeof n === "undefined" ? "." : n,
        a = "",
        f = function(e, t) {
            var n = Math.pow(10, t);
            return "" + Math.round(e * n) / n
        };
    a = (s ? f(i, s) : "" + Math.round(i)).split(".");
    if (a[0].length > 3) {
        a[0] = a[0].replace(/\B(?=(?:\d{3})+(?!\d))/g, o)
    }
    if ((a[1] || "").length < s) {
        a[1] = a[1] || "";
        a[1] += (new Array(s - a[1].length + 1)).join("0")
    }
    return a.join(u)
}

